import styled from "styled-components";

export const CompanyConteiner = styled.div`
  display: grid;
  grid-template-columns: 311px 336px;
  height: 561px;
`;

export const VectorTop = styled.div`
  margin-top: 47px;
  width: 100%;
  border-bottom: solid 2px #060606;
`;
